import { Navbar } from "../../components/navbar";
import { PageContainer } from "../../components/pageContainer";
import { TopSection } from "./topSection";

export function Home(props) {
    return (
        <PageContainer>
            <TopSection>
                <Navbar useTransparent />
            </TopSection>
        </PageContainer>
    );
};
